import ExpenseForm from "./ExpenseForm";

const ShowExpenseForm = (props) => {

    const onClickHandler = (event) => {
       return <ExpenseForm onSaveExpenseData={props.onSaveExpenseData}/>
    }

    return (
        <div>
            <button onClick={onClickHandler}>Add new expense</button>
        </div>
    )
}

export default ShowExpenseForm;
